ack for CRONUS ZEN #zenyourgame\n\n Includes a brand new state-of-the-art Anti-Recoil engine that includes built-in anti-recoil values and other presets for the latest weapons (updated every patch!)\n\n Also includes brand new Aim Assist code which is \n\n There are three Weapon Profiles where you can save different weapons with different settings/different attachments (Primary, Secondary and a third Weapon), so they can be activated in seconds from your controller using special Zen Quick Toggle Combos.\n\n Other essential options include Display Slot Number, ADS Fine Tuning, Hip Fine Tuning, Rapid Fire, Dynamic Rapid Fire, Burst Fire, Custom Fire, Drop Shot, Strafe Shot, Crouch Spam, Auto Reload, Auto Melee, Fire Frag, Auto Sprint, and Hair Triggers. \n\n All default button layouts are supported, including Bumper Swap, Trigger Swap, Bumper/Trigger Swap, and all stick layouts.\n\n Here's a link to the latest instructions for this GamePack: https://gamepacks.cronusmax.com/zen-gamepacks/tom-clancys-ghost-recon-wildlands\n\n Here are the chapter timecodes so you can easily navigate the video:\n\nIntro: 00:00 - 00:20\nAnti-Recoil 00:21 - 00:33\nAim Assist: 00:33 - 00:44\nFire Mods: 00:44 - 00:55\nShot Mods: 00:55 - 01:05\nAuto Melee: 01:05 - 01:10\nAuto Reload: 01:10 - 01:16\nFire Frag: 01:16 - 01:22\nFinale: 01:22 - 01:50\n\n Subscribe to our YouTube channel to get notified whenever we release new content for Cronus Zen, including controller guides, GamePack walkthroughs, troubleshooting tips, and more!\n\n You can also get LIVE direct support from the team in the Official Cronus Discord (available to Registered Zen Users Only): https://discord.gg/cronuszen\n\n Special thanks to the Cronus Community GamePack Team:\nBatts\nExcalibur\nLegitCloudzzz\nx22 DOT\nXBL Jedi\n\n Special mentions for their scripting skills and awesome contributions to the Cronus Community:\nDogzTheFighter\nFadexz\nNoozbar\nTaylorDrift21\n\n\nThanks for watching!\nCharlie // MaxADMIN\n#cronuszen #gamepacks #freemods #zenyourgame\n\nCronus Community Links:\nCronus Website: https://cronusmax.com/\nCronus Zen User Guide: https://beta.cronusmax.com/\nCronus Zen 32bit GamePacks: https://beta.cronusmax.com/gamepacks-32bit\nCronus Zen 16bit GamePacks: https://gamepacks.cronusmax.com/\nCronus Downloads: https://cronusmax.com/downloads\nCronus Community Forums: https://beta.cronusmax.com/join-the-cronus-community\nCronus Discord: https://discord.gg/cronuszen\nCronus Support Center: https://support.cronusmax.com/"},"lengthSeconds":"111","ownerProfileUrl":"http://www.youtube.com/user/cronusmax","externalChannelId":"UCTQgjSMB0aJtgKJ74wILAjg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":true,"hasYpcMetadata":false,"viewCount":"1131","categ
